import React from "react";
import styled from "styled-components";

export default function About() {
  const Para = styled.p`
    font-size: 1.6rem;
    margin-top: 2%;
    margin-left: 3%;
    width: 95%;
  `;
  return (
    <div className="about">
      <h2 className="title">About</h2>
      <Para className="para">
        Climb leg. Cat fur is the new black fat baby cat best buddy little guy
        eat and than sleep on your face where is my slave? I'm getting hungry or
        lick yarn hanging out of own butt. Rub my belly hiss cough for mouse.
        Refuse to leave cardboard box. If human is on laptop sit on the keyboard
        bird bird bird bird bird bird human why take bird out i could have eaten
        that yet sleeps on my head sleeps on my head swipe at owner's legs.Licks
        paws chase after silly colored fish toys around the house.

        Bird bird
